import React from 'react';

function Building({buildingZone, buildings=""}) {
    return (
        <div>
            <h1>{buildingZone}</h1>
            <ul>
                {buildings.map((building,index)=>{
                    return <li key={index}>{building.buildingname}</li>
                })}
            </ul>
        </div>
    );
};

export default Building;
